window.bookSummaryJSON = "<p><b>Darkness stirs in the depths of the world!</b><br> <br> As Gareth and his friends celebrate their latest victory in their quest to topple the gods, an ancient horror wakes half the world away. Asked to help by a traveler to the tower they must seek out the terror lurking beneath the far side of Acamida.<br> <br> With this new Dverger ally by his side, Gareth must navigate the treacherous outback, battling horrid monsters and discovering ancient secrets in its dusty wastes. Gareth will need every skill and card he owns to survive as he helps end a generations-old feud.<br> <br> As Gareth grows in power, so too does his terrifying new foe. Two great powers start a collision course that will change the fate of Acamida forever!</p>"; 
